/**
 * Read an 8-digit hex block, reversing the order of the digit couples (for bmp)
 */
uint32_t read32( uint8_t *buff, int offset ) {
    uint32_t result = 0;
    
    result ^= ((uint32_t)(buff[offset+0])) << 0;
    result ^= ((uint32_t)(buff[offset+1])) << 8;
    result ^= ((uint32_t)(buff[offset+2])) << 16;
    result ^= ((uint32_t)(buff[offset+3])) << 24;
    
    return result;
}

